(function(){app.EditContactView=Backbone.View.extend({template:Handlebars.compile($("#contact-form-template").html()),events:{"click #save-contact":"save","click #delete-contact":"deleteContact"},initialize:function(){app.Contacts.push(this.model)},render:function(){this.$el.html(this.template(this.model.toJSON()));return this},save:function(){var d=$("#name").val(),c=$("#address").val(),b=$("#phone").val(),a;if(d&&c&&b){a=this.model.set({name:d,address:c,phoneNumber:b});a.save()}else{return false}},deleteContact:function(){this.model.destroy()}})})();